Defendant Carla M Welch in court, in custody, with attorney J A Rosario.    District Attorney's Office Law Intern appeared for the State of Wisconsin.  Abbey Nickolie in court.    Defendant enters a guilty plea to Counts 1 and 2.  Court finds defendant guilty.  

The Court Orders the Following:

COUNT 1

Imposed and Stayed Sentence of:

9 Months Jail STRAIGHT TIME (Credit - 0 days) CONSECUTIVE TO COUNT 2

Term of Probation: 2 Years  CONSECUTIVE TO EXTENDED SUPERVISION IN COUNT 2

Conditions of Probation:
- No Use or Possession of  illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Maintain/Obtain full time employment ;
-Perform 30 hours of community service each year;
- No contact with co actors, Modern Woodman's Stores.
- Provide DNA sample if not yet provided  and pay surcharge

Costs: $ 243.00
DNA Surcharge:  $200.00
(To to be paid as a condition of probation).



COUNT 2

Imposed  Sentence of:

3 Years 6 months Imprisonment (Credit - 78 days )
- 1 Years  6 Months of Initial Confinement
- 2 Years of Extended Supervision

Conditions of Extend Supervision:
- No Use or Possession of  illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Maintain/Obtain full time employment ;
-Perform 30 hours of community service each year;
- No contact with co actors, Modern Woodman's Stores.
- Provide DNA sample if not yet provided  and pay surcharge

Restitution: $251.41  joint and several (to be paid as a condition of extended supervision)

Costs: $ 278.00
DNA Surcharge:  $250.00
(To to be paid as a condition of extended supervision).

Defendant is not eligible for the Challenge Incarceration Program
Defendant is not eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
